제6조 (이용신청)
1.회원으로 가입하여 서비스를 이용하기를 희망하는 자는 “잡콜미”가 요청하는 소정의 가입 신청 양식에서 요구하는 사항을 기록하여 신청합니다.
2.온라인 가입신청 양식에 기재하는 모든 회원 정보는 실제 데이터인 것으로 간주하므로 실명이나 실제 정보를 입력하지 않은 서비스 사용의 제한을 받으시거나 법적 보호를 받지 못 하실 수 있습니다.
3.한국 이외의 지역에서 서비스를 이용하고자 하는 회원은 회원의 개인 데이터가 한국에 전송되고 한국 내에서 처리되는 것에 동의해야 합니다.

제7조 (이용 신청의 승낙)
1.“잡콜미”는 제6조에 따른 이용자의 이용신청에 대하여 신용정보의 이용 및 보호에 관한 법률이 정하는 신용불량자로 등록되어 있는 등의 특별한 사정이 없는 한 접수 순서대로 이용 신청을 승낙합니다.
2.“잡콜미”는 다음 각 호에 해당하는 경우 이용신청에 대한 승낙을 제한하거나, 그 사유가 해소될 때까지 승낙을 유보할 수 있으며, 사후에 라도 이용계약을 해지할 수 있습니다
a.	  a)서비스 관련 설비에 여유가 없는 경우.
b).기술상 지장이 있는 경우.
c)기타 “잡콜미”의 사정상 필요하다고 인정되는 경우.
3..“잡콜미”는 다음 각 호에 해당하는 이용계약 신청에 대하여는 이를 승낙하지 않을 수 있습니다.
a)본인의 실명으로 신청하지 않은 경우.
b)다른 사람의 명의를 사용하여 신청한 경우.
C)이용 신청 시 허위의 정보를 기재하거나, 허위서류를 첨부하는 경우, “잡콜미”가 제시하는 내용을 기재하지 않은 경우
d)사회의 안녕과 질서 혹은 미풍양속을 저해할 목적으로 신청한 경우.
e)본 약관 제19조 제4항에 따라 회원자격을 상실한 적이 있는 경우.
f)이용자의 귀책사유로 인하여 승인이 불가능하거나 기타 규정한 제반 사항을 위반하며 신청하는 경우
g)기타 “잡콜미”가 정한 이용 신청 요건이 미흡한 경우.
4.제2항 또는 제3항에 의하여 이용신청의 승낙을 유보하거나 승낙하지 아니하는 경우, “잡콜미”는 이를 이용신청자에게 알려야 합니다. 다만, “잡콜미”의 귀책사유 없이 이용신청자에게 통지할 수 없는 경우는 예외로 합니다.
5.“잡콜미”는 관계법령에서 규정하는 미성년자일 경우에 서비스별 안내에서 정하는 바에 따라 이용계약 신청의 승낙을 보류할 수 있습니다. “잡콜미”는 "회원"에 대해 "영화 및 비디오물의 진흥에 관한법률" 및 "청소년보호법"등에 따른 등급 및 연령 준수를 위해 이용제한이나 등급별 제한을 할 수 있습니다.

제8조 (개인정보의 보호)
“잡콜미”는 회원의 개인정보 보호를 위해 최선을 다하고 있습니다. 회원의 개인정보 보호 및 회원이 “잡콜미”를 이용하여 회원의 콘텐츠를 타인과 공유하고 “잡콜미”가 이를 수집 및 이용하는 방법에 대해 중요한 사항은 개인정보취급방침이 적용됩니다. 개인정보취급방침을 읽고 올바른 판단을 내리는 데 활용하시기 바랍니다.

제9조 (계약 사항의 변경)
1.회원은 개인정보관리를 통해 언제든지 본인의 개인정보를 열람하고 수정할 수 있습니다. 다만, 서비스 관리를 위해 필요한 실명, 아이디 등은 수정이 불가능합니다.
2.회원은 이용신청 시 기재한 사항이 변경되었을 경우 온라인 수정 및 전자우편으로 “잡콜미”에 그 변경사항을 알려야 합니다. 회원정보의 변경의 미통보로 인하여 발생한 손해의 책임은 회원에게 있습니다.

제3장 계약 당사자의 의무
제10조 (“잡콜미”의 의무)
1.“잡콜미”는 본 약관에서 정한 바에 따라 계속적이고 안정적인 서비스의 제공을 위하여 지속적으로 노력하며, 설비에 장애가 생기거나 멸실 된 때에는 지체 없이 이를 수리 복구합니다. 다만, 천재지변, 비상사태 또는 그밖에 부득이한 경우에는 그 서비스를 일시 중단하거나 중지할 수 있으며, 서비스 운영상, 기술상 필요하고 상당한 이유가 있는 경우 서비스의 전부, 또는 일부를 변경할 수 있습니다. 서비스의 전부, 또는 일부를 변경할 경우 다음 각 호에서 정한 바에 따릅니다.
a)서비스의 내용, 이용방법, 이용시간에 대하여 변경이 있는 경우에는 변경사유, 변경될 서비스의 내용 및 제공일자 등을 그 변경 전에 사이트에 게시합니다
b)무료로 제공되는 서비스의 일부 또는 전부를 수정, 중단, 변경할 경우 관련법에 특별한 규정이 없는 한 회원에게 별도의 보상을 하지 않습니다.
2.“잡콜미”는 회원으로부터 소정의 절차에 의해 제기되는 의견이나 불만이 정당하다고 인정할 경우에는 적절한 절차를 거처 처리합니다. 처리 시 일정 기간이 소요될 경우 회원에게 게시판, 전자우편, 기타 수단 등을 이용하여 그 사유와 처리 일정을 알려드립니다.
3.“잡콜미”는 이용계약의 체결, 계약사항의 변경 및 해지 등 이용고객과의 계약 관련 절차 및 내용 등에 있어 이용고객에게 편의를 제공하도록 노력합니다.
4.“잡콜미”는 정보통신망 이용촉진 등에 관한 법률, 통신비밀보호법, 전기통신기본법 등 서비스의 운영, 유지와 관련 있는 법규를 준수합니다.

제11조 (회원의 의무)
1.유료 서비스를 사용하는 “잡콜미” 회원은 서비스 이용에 대한 대가로 “잡콜미”가 책정한 서비스 요금 등을 “잡콜미”에 지불하여야 합니다. 유료서비스 이용에 따른 요금 지급 등은 “잡콜미”유료서비스 이용 및 결제약관이 적용됩니다.
2.회원은 이 약관에서 규정하는 사항과 서비스 이용안내 또는 주의사항 등 “잡콜미”가 공지 혹은 통지하는 사항을 준수하여야 하며, 기타 “잡콜미” 운영에 방해되는 행위를 하여서는 안 됩니다. 본 약관의 규정이나 정신을 위반하거나 “잡콜미”에 위험이나 법적 피해를 초래한다면 “잡콜미”서비스 전체나 일부의 제공을 중단할 수 있습니다. 이와 같은 사실은 이메일을 통해 또는 추후 계정 접속을 시도할 때 알려 드립니다. 회원은 언제든지 본인의 계정을 삭제할 수 있습니다.
3.회원은 서비스 이용을 위한 회원 ID, 비밀번호의 관리에 대한 책임, 본인 ID의 제3자에 의한 부정사용 등 회원의 고의⋅과실로 인해 발생하는 모든 불이익에 대한 책임을 부담합니다. 단, 이것이 “잡콜미”의 고의⋅과실로 인하여 야기된 경우는 “잡콜미”가 책임을 부담합니다. “잡콜미”는 일부 서비스에 오픈아이디를 지원하나 오픈아이디의 발급, 인증 서비스 업체가 제공 및 관리하는 아이디,비밀번호 인증 등과 관련된 부분에 대해서는 책임지지 않습니다. “잡콜미”는 다음 각 호의 경우 해당 아이디의 이용을 제한할 수 있습니다.
a)개인정보 유출 우려가 있는 경우
b)반사회적 또는 미풍양속에 어긋나는 경우
c)“잡콜미” 및 “잡콜미”의 운영자로 오인할 우려가 있는 경우
4.회원은 내용 별로 “잡콜미”가 서비스 공지사항에 게시하거나 전자우편 등 별도로 공지한 이용제한 사항을 준수하여야 합니다.
5.회원은 “잡콜미”의 사전 승낙 없이는 서비스를 이용하여 영업활동을 할 수 없으며, 회원이 약관에 위반한 영업활동을 하여 발생한 결과에 대해서 “잡콜미”는 책임을 지지 않습니다. 회원은 이와 같은 영업활동으로 “잡콜미”가 손해를 입은 경우, “잡콜미”에 대하여 손해배상의무를 집니다.
6.회원은 “잡콜미”의 명시적인 동의가 없는 한 서비스의 이용권한, 기타 이용계약 상 지위를 타인에게 양도, 증여할 수 없으며, 이를 담보로 제공할 수 없습니다.
7.“잡콜미”를 안전하게 유지하기 위해 최선을 다하고 있지만 회원이 다음 각 호의 행위를 하는 경우에는 안전을 보장할 수 없습니다. 안전을 위해서 회원은 서비스 이용과 관련하여 다음 각 호에 해당되는 행위를 하여서는 아니 됩니다.
a)다른 회원의 ID와 비밀번호 등을 도용하는 행위.
b)본 서비스를 통하여 얻은 정보를 “잡콜미”의 사전 승낙 없이 회원의 이용 이외 목적으로 복제하거나 이를 출판 및 방송 등에 사용하거나 제3자에게 제공하는 행위.
c)타인의 특허, 상표, 영업비밀, 저작권 기타 지적재산권을 침해하는 내용을 게시, 전자메일,실시간 화상채팅 또는 기타의 방법으로 타인에게 유포하는 행위.
d)공공질서 및 미풍양속에 위반되는 저속, 음란, 증오, 폭력적인 내용의 정보, 문장, 도형 등을 전송, 게시, 전자메일 또는 기타의 방법으로 타인에게 유포하는 행위.
e)모욕적이거나 위협적이어서 타인의 프라이버시를 침해할 수 있는 내용을 전송, 게시, 전자메일,실시간 화상채팅 또는 기타의 방법으로 타인에게 유포하는 행위.
f)“잡콜미”가 제공하는 서비스를 이용하여 불법적이거나 오해의 소지가 있거나 악의적이거나 차별적인 활동을 하는 행위
g)관련 법령에 의하여 그 전송 또는 게시가 금지되는 정보(컴퓨터 프로그램 등)를 전송 또는 게시하는 행위
h)서비스 거부 공격과 같이 서비스의 적절한 작동을 무력하게 만들거나 과도한 부담을 주거나 저해할 수 있는 행위
i)“잡콜미”의 허가없이 자동화된 수단(예, 수집 봇, 로봇, 스파이더, 스크래퍼)을 이용하여 사용자의 콘텐츠나 정보를 수집하거나 다른 방식을 통해 접근하는 행위
j)컴퓨터 소프트웨어, 하드웨어, 전기통신 장비의 정상적인 가동을 방해, 파괴할 목적으로 고안된 소프트웨어 바이러스, 기타 다른 컴퓨터 코드, 파일, 프로그램을 포함하고 있는 자료를 게시하거나 전자우편으로 발송하는 행위
k)불특정 다수의 자를 대상으로 하여 광고 또는 선전을 게시하거나 스팸메일을 전송하는 등의 방법으로 “잡콜미”의 서비스를 이용하여 영리목적의 활동을 하는 행위
l)적절한 연령 기준 제한 없이 주류나 기타 성인 관련 콘텐츠(광고 포함)가 담긴 타사 어플리케이션을 개발하거나 운영하는 행위
m)정크메일(junk mail), 행운의 편지(chain letters), 피라미드 조직에 가입할 것을 권유하는 메일을 보내거나 기타 공서양속에 반하는 정보를 공개 또는 게시하는 행위
n)“잡콜미”의 사전 서면 동의 없이 경연이나 경품 등(이하 "프로모션"라 함)을 “잡콜미” 서비스 내에서 제공하는 행위 . “잡콜미”가 동의하는 경우에도 홍보에 대한 책임은 전적으로 회원에게 있으며, “잡콜미”의 프로모션가이드라인 및 관련 법규를 모두 준수해야 합니다.
o)“잡콜미”의 직원이나 관리자를 가장하거나 사칭하여 내용물을 게시, 등록, 변경]하거나 메일을 발송하는 행위.
p)범죄와 결부된다고 객관적으로 판단되는 행위.
q)“잡콜미”의 승인을 받지 않고 다른 사용자의 개인정보를 수집 또는 저장하는 행위.
r)본 약관의 위반을 조장하거나 권장하는 행위
s)기타 관계법령에 위배되는 행위.
t)채용공고를 등록하고자 하는 회원은 다음 각 목의 행위를 해서는 안됩니다.
I)실명이 아닌 이름으로 가입하는 행위
II)사실과 다르거나 조작된 내용의 정보를 등록하는 행위.
III)허위 채용공고를 등록하는 행위.
IV)사업자등록증에 나타난 정보와 일치하지 않는 정보로 기업회원에 가입하는 행위
V)지사, 지점, 영업소 등의 경우 구체적인 지사, 지점, 영업소 명칭을 사용하지 않고 기업명을 등록하거나 지사, 지점, 영업소의 사업자등록번호가 별도 있음에도 불구하고 본사의 사업자등록번호로 기업회원 가입을 하는 행위.
VI)업체명, 담당자 성명, 사무실 연락처 등 구인 업체의 중요 정보를 정확하게 기입하지 않는 행위.
VII)모집요강에 적합한 분류를 지정하지 않거나 직접 관련되지 않는 업종, 직종 분류를 지정하는 행위
VIII))취업 시 수수료를 지불해야 하거나 교육비 명목으로 개인에게 비용을 요구하는 행위
IX)동일 아이피로 동일 내용 채용공고를 중복 등록하는 행위.
X))동일 회원ID로 마감일이 지나지 않은 사실상의 동일 내용 채용공고를 중복 등록하는 행위.
XI)회사명을 수시로 변경하며 동일한 구인공고를 올리는 행위.
XII)임금체불, 기타 노동관계법령 위반사실이 법원이나 검찰, 노동부, 기타 관할기관에 접수되어 있는 기업(개인사업자 포함)이 채용공고를 등록하는 행위
XIII)채용으로 보기 어려운 대리점주, 지사장, 총판 등의 사업자 모집을 개시하는 행위

8.“잡콜미” 및 회원은 타인의 권리를 보호하기 위해 다음 각 호에서 정한 사항을 이행합니다.
a)“잡콜미”는 타인의 권리를 존중하며, 회원도 이를 존중해야 합니다.
b)회원은 타인의 권리를 침해하여서는 아니되며 법률을 위반하는 콘텐츠를 게시하거나 그러한 조치를 취할 수 없습니다. 이에 위반하는 콘텐츠나 정보를 “잡콜미”가 임의로 제거할 수 있습니다.
c)“잡콜미”는 회원의 지적 재산권을 보호합니다.
d) “잡콜미”가 타인의 저작권 침해를 이유로 제거한 회원의 콘텐츠가 실수로 제거되었다고 판단된다면, 재고를 요청할 기회를 드립니다.
e)상습적으로 타인의 지적 재산권을 침해하는 경우, 회원 계정이 비활성화될 수 있습니다.
f)“잡콜미”의 서면 허가 없이 “잡콜미”의 저작권이나 상표권 및 “잡콜미”와 혼동되는 유사 상표를 사용할 수 없습니다.
g)사용자로부터 정보를 수집하는 경우에는 사용자의 동의를 구하고 정보를 수집하는 주체는 회원(“잡콜미”가 아니라)임을 분명히 밝히고 회원이 수집하는 정보와 이용 방법을 설명하는 개인정보 취급방침을 게시해야 합니다.
h)타인의 신분 증명 문서나 민감한 금융 정보는 게시할 수 없습니다.
i)동의 없이 사용자를 태그하거나 비사용자에게 이메일 초대장을 전송할 수 없습니다.

9)“잡콜미”의 모바일 서비스는 다음 각 호에서 정한 바에 따라 제공됩니다.
a)“잡콜미”는 현재 모바일 서비스를 무료로 제공하지만, 문자 메시지 수수료와 같이 이동통신사의 정규 요금 및 수수료는 적용됩니다.
b)회원의 휴대폰 번호를 변경하거나 비활성화하는 경우에는 회원의 기존 번호를 습득하는 사람에게 회원의 메시지가 전송되지 않도록 48시간 내에 “잡콜미”의 계정 정보를 업데이트해야 합니다.
c)회원은 “잡콜미”에 보이는 기본 정보와 연락처 정보뿐 아니라 회원의 이름 및 프로필 사진과 본인의 연락처 목록을 동기화(어플리케이션을 통한 동기화 포함)하는 데 필요한 모든 권리를 제공합니다.
d)모바일에서 등록한 콘텐츠, 프로필, 개인정보는 웹과 동일한 약관이 적용됩니다.
10)플랫폼 어플리케이션이나 웹 사이트의 개발자나 운영자에 해당하는 회원에 대해서는 다음 각 호의 내용이 추가 적용됩니다.
a)플랫폼을 이용하여 만드는 어플리케이션과 콘텐츠, 용도에 대한 책임은 개발자나 운영자인 회원에게 있습니다. 어플리케이션이나 플랫폼의 이용은 “잡콜미”의 개발자 원칙 및 정책 그리고 “잡콜미”의 광고 가이드라인에 부합해야 합니다.
b)회원이 “잡콜미”에서 수신하는 데이터에 대한 접근과 사용은 다음 각 목과 같이 제한됩니다.
I)회원의 어플리케이션을 운영하는데 필요한 데이터만 요청할 수 있습니다.
II)회원이 사용할 사용자 데이터와 데이터를 사용, 표시, 공유, 전송하는 방법을 알려주는 개인정보 취급방침이 있어야 하며, 개발자 어플리케이션에 회원의 개인정보 취급방침 URL을 포함시켜야 합니다.
III)회원의 개인정보 취급방침에 부합하지 않는 방식으로 사용자 데이터를 사용, 표시, 공유, 전송할 수 없습니다.
IV)사용자에 관해 “잡콜미”로부터 수신하는 모든 데이터는 사용자의 요구가 있을 경우 삭제해야 하며, 사용자가 이를 요청할 수 있는 메커니즘을 제공해야 합니다.
V)사용자에 관하여 “잡콜미”로부터 수신하는 데이터는 광고 창작물에 포함시킬 수 없습니다.
VI)“잡콜미”로부터 수신하는 데이터는 사용자가 동의하더라도 직접 또는 간접적으로 광고 네트워크와 광고 거래소, 데이터 브로커를 비롯한 광고 관련 툴셋에 전송(하거나 그와 관련하여 해당 데이터를 사용)할 수 없습니다.
VII)사용자 데이터는 판매할 수 없습니다. 제3자에 인수 또는 합병되는 경우에는 회원의 어플리케이션 내에서 사용자 데이터를 계속 사용할 수 있지만, 회원의 어플리케이션 외부로 사용자 데이터를 전송할 수 없습니다.
VIII)“잡콜미”는 사용자의 기대에 부합하지 않는다고 판단될 경우 사용자 데이터의 삭제를 요구할 수 있습니다.
IX)“잡콜미”는 회원의 데이터 접근을 제한할 수 있습니다.
X)“잡콜미”의 개발자 원칙 및 정책에 포함된 기타 제한 사항을 준수해야 합니다.
c)회원이 사용자나 사용자의 콘텐츠에서 독자적으로 수집하는 정보는 사용자의 동의 없이 “잡콜미”에 제공할 수 없습니다.
d)사용자는 회원의 어플리케이션에서 쉽게 제거 또는 분리될 수 있어야 합니다.
e)사용자는 회원에게 쉽게 연락할 수 있어야 합니다. 또한 “잡콜미”는 회원이 권리를 침해 또는 위반하였다고 주장하는 사용자 및 타인과 회원의 이메일 주소를 공유할 수 있습니다.
f)회원의 어플리케이션에 대해 고객 지원을 제공해야 합니다.
g)“잡콜미”에 타사 광고나 웹 검색 상자를 표시할 수 없습니다.
h)“잡콜미”로부터 수신하는 코드, API, 데이터, 툴을 이용하는데 필요한 모든 권리를 회원에게 부여합니다.
i)“잡콜미”의 코드나 API, 툴은 타인에게 판매, 양도, 재허가할 수 없습니다.
j)타인에게 “잡콜미”와의 관계를 허위 진술해서는 안 됩니다.
k)“잡콜미”의 개발자 원칙 및 정책을 준수하는 경우에는 “잡콜미”가 개발자에게 제공하는 로고를 사용하거나 보도 자료 또는 기타 공개 발표문을 발행할 수 있습니다.
l)“잡콜미”는 회원과의 관계를 설명하는 보도자료를 발행할 수 있습니다.
m)회원은 모든 관련 법규를 준수해야 합니다.
n)플랫폼이 항상 무료라고 보장하지는 않습니다.
o)회원이 “잡콜미”에 제공하는 콘텐츠나 정보를 스트림, 프로필, 사용자 활동 스토리에 통합할 수 있는 권리를 비롯하여 회원의 어플리케이션이 “잡콜미”에서 작동하는데 필요한 모든 권리를 “잡콜미”에 제공해야 합니다.
p)회원의 어플리케이션에 링크하거나 프레임을 만들거나 광고를 비롯한 콘텐츠를 배치할 권리를 “잡콜미”에 제공해야 합니다.
q)“잡콜미”는 상업 광고(예, 광고 전달 대상을 정하거나 콘텐츠를 검색에 등록하는 행위)를 비롯하여 모든 목적을 위해 회원의 어플리케이션과 콘텐츠, 데이터를 분석할 수 있습니다.
r)회원의 어플리케이션이 사용자에게 안전한지 확인하기 위하여 어플리케이션을 감사할 수 있습니다.
s)회원의 어플리케이션과 유사한 기능 및 서비스를 제공하는 어플리케이션을 만들거나 다른 형태로 경쟁할 수 있습니다.

제4장 서비스 이용

제12조 (정보의 제공)
이용자는 “잡콜미”의 자체 서비스 및 공지내용을 이메일 또는 휴대폰 문자메시지로 받을 수 있으며, 광고 정보의 경우 수신 여부를 선택 할 수 있고, 수신에 동의한 회원에 한하여 광고 정보를 받게 됩니다. 다만, 회원의 거래관련 정보 및 고객문의 등에 대한 회신에 있어서는 제외됩니다.

제13조 (회원의 게시물)
“잡콜미”의 각 게시판에 이용자가 글을 작성할 경우 글쓴이의 IP는 비공개를 원칙으로 합니다. 또한 “잡콜미”는 회원이 게시하거나 등록하는 서비스내의 내용물이 다음 각 호의 1에 해당한다고 판단되는 경우에 게시판 이용 금지 및 강제 회원탈퇴 등 이용 상 제한을 할 수 있습니다.
a)다른 회원 또는 제3자를 비방하거나 중상모략으로 명예를 손상시키는 내용인 경우.
b)공공질서 및 미풍양속에 위반되는 내용인 경우(예. 욕설, 음란 등).
c)범죄적 행위에 결부된다고 인정되는 내용일 경우 (예. 자살 모의, 도박, 절도 등).
d)“잡콜미” 및 다른 회원 혹은 제3자의 저작권을 포함한 지적재산권 등 기타 권리를 침해하는 내용인 경우.
e)서비스에 위해를 가하거나 바이러스 감염자료 게재 등으로 서비스의 건전한 운영을 저해하는 경우(예. 게시판 도배 행위, 해킹 등).
f)기타 관계법령에 위반되거나, 본 약관 제11조 제8항에 해당한다고 판단되는 경우.

제14조 (게시물 관리)
1.“잡콜미”는 건전한 통신문화정착과 효율적인 서비스 운영을 위하여 이용자가 게시하거나 제공하는 자료가 다음에 해당한다고 판단되는 경우에 임의로 삭제, 적합한 위치로의 자료이동, 등록거부를 할 수 있습니다.
a)“잡콜미”에서 규정한 게시기간을 초과한 경우.
b)게시판의 성격에 부합하지 않는 게시물의 경우.
c)제3자 또는 “잡콜미”의 명예, 신용을 훼손하거나 오용하는 내용 또는 영업을 방해하는 내용인 경우.
d)범죄적 행위와 결부된다고 객관적으로 인정되는 내용인 경우.
e)제3자 또는 “잡콜미”의 지적재산권 등 권리를 침해하는 내용인 경우.
f)제11조 제8항에 해당하는 경우
g)"정보통신망법" 및 "저작권법"등 관계법령 및 “잡콜미”의 게시물 관리 규정에 위배된다고 판단되는 경우.
2.정보통신망 이용촉진 및 정보보호 등에 관한 법률(이하 "정보통신망법"이라 합니다)의 규정에 의해 다른 회원의 공개된 게시물 등이 본인의 사생활을 침해하거나 명예를 훼손하는 등 권리를 침해 받은 회원 또는 제3자(이하 "삭제 등 신청인"이라 합니다)는 그 침해사실을 소명하여 “잡콜미”에 해당 게시물 등의 삭제 또는 반박 내용의 게재를 요청할 수 있습니다. 이 경우 “잡콜미”는 해당 게시물 등의 권리 침해 여부를 판단할 수 없거나 당사자 간의 다툼이 예상되는 경우 해당 게시물 등에 대한 접근을 임시적으로 차단하는 조치(이하 "임시조치"라 합니다)를 최장 30일까지 취합니다.
3.제2항에 의해 본인의 게시물 등이 임시조치 된 회원(이하 "게시자"라 합니다)은 임시조치기간 중 “잡콜미”에 해당 게시물 등을 복원해 줄 것을 요청(이하 "재게시 청구"라 합니다)할 수 있으며, “잡콜미”는 임시조치된 게시물의 명예훼손 등 판단에 대한 방송통신심의위원회 심의 요청에 대한 게시자 및 삭제 등 신청인의 동의가 있는 경우 게시자 및 삭제 등 신청인을 대리하여 이를 요청하고 동의가 없는 경우 “잡콜미”가 이를 판단하여 게시물 등의 복원 여부를 결정합니다. 게시자의 재게시 청구가 있는 경우 임시조치 기간 내에 방송통신심의위원회 또는 “잡콜미”의 결정이 있으면 그 결정에 따르고 그 결정이 임시조치 기간 내에 있지 않는 경우 해당 게시물 등은 임시조치 만료일 이후 복원됩니다. 재게시 청구가 없는 경우 해당 게시물 등은 임시조치 기간 만료 이후 삭제됩니다.
4.“잡콜미”는 서비스 내에 게시된 게시물 등이 사생활 침해 또는 명예훼손 등 제3자의 권리를 침해한다고 인정하는 경우 제2항에 따른 회원 또는 제3자의 신고가 없는 경우에도 임시조치(이하 "임의의 임시조치"라 합니다)를 취할 수 있습니다. 임의의 임시조치된 게시물의 처리 절차는 제2항 후단 및 제3항의 규정에 따릅니다.
5.회원의 게시물 등으로 인한 법률상 이익 침해를 근거로, 다른 회원 또는 제3자가 회원 또는 “잡콜미”를 대상으로 하여 민형사상의 법적 조치(예: 형사고소, 가처분 신청⋅손해배상청구 등 민사소송의 제기)를 취하는 경우, “잡콜미”는 동 법적 조치의 결과인 법원의 확정판결이 있을 때까지 관련 게시물 등에 대한 접근을 잠정적으로 제한할 수 있습니다. 게시물 등의 접근 제한과 관련한 법적 조치의 소명, 법원의 확정 판결에 대한 소명 책임은 게시물 등에 대한 조치를 요청하는 자가 부담합니다.

제15조 (게시물의 저작권 및 권리의 귀속과 컨텐츠의 공유)
1)서비스에 게재된 자료에 대한 권리는 다음 각 호의 내용과 같습니다.
a)“잡콜미”가 작성한 저작물에 대한 저작권 기타 지적재산권은 “잡콜미”사에 귀속합니다. 단, "회원"의 "게시물" 및 제휴계약에 따라 제공된 저작물 등은 제외합니다.
b)"“잡콜미”"는 서비스와 관련하여 "회원"에게 "“잡콜미”"가 정한 이용조건에 따라 계정, "아이디", 콘텐츠, "포인트" 등을 이용할 수 있는 이용권만을 부여하며, 회원은 서비스를 이용함으로써 얻은 정보를 “잡콜미”의 사전 승낙 없이 복제, 송신, 출판, 전송, 배포, 방송 기타 방법에 의하여 영리목적으로 이용하거나 판매, 담보제공 혹은 제3자에게 이용하게 하여서는 안됩니다.
c)회원이 게시하는 콘텐츠와 정보의 모든 소유권은 회원에게 있으며, 개인 정보 설정 및 어플리케이션 설정을 통하여 정보 공유 범위를 정할 수 있습니다.
d)회원은 자신이 창작, 등록한 사진이나 동영상과 같은 지적 재산권이 적용되는 콘텐츠(이하 "IP 콘텐츠"라 함)에 대해 다음의 각 목에서 정한 바에 따라 “잡콜미”에게 사용권한을 부여합니다. 회원은 “잡콜미”에 대한 사용권한 부여를 회원의 개인 정보 설정 및 어플리케이션 설정에서 결정할 수 있습니다.
I)회원은 회원의 IP콘텐츠를 서비스에 게시하거나 이와 관련한 사용행위(복제, 배포, 전시, 전송, 출판, 2차적 저작물의 작성)를 할 수 있는 권한을 “잡콜미”에게 부여합니다. 단, “잡콜미”에 부여된 권한은 전 세계를 대상으로 하며, 비독점적이고, 양도 또는 재면허를 부여할 수 있고, 그에 대한 사용료, 기타 반대급부는 무상으로 합니다.
II)회원이 “잡콜미”에 부여한 권한은 회원이 회원의 IP 콘텐츠나 계정을 삭제할 때 종료됩니다. 단, 회원이 콘텐츠를 타인과 공유하고 타인이 이를 삭제하지 않았을 경우에는 그러하지 아니합니다. 외부 API등 오픈플랫폼을 제공하는 서비스에 저장되는 경우 콘텐츠 유실 등의 책임은 “잡콜미”가 부담하지 않습니다.
III)콘텐츠를 삭제하면 컴퓨터의 휴지통을 비우는 것과 유사한 방식으로 콘텐츠가 삭제됩니다. 단, 제거된 콘텐츠는 일정 기간 동안 백업 사본으로 존속될 수 있으며, 백업 사본으로 존속되는 동안에도 타인에게 제공되지는 않습니다.
IV)어플리케이션을 이용할 경우 회원의 콘텐츠나 정보는 어플리케이션과 공유됩니다. 해당 어플리케이션과 회원의 계약은 어플리케이션이 해당 콘텐츠나 정보를 이용, 저장, 전송하는 방법에 적용됩니다.
e)회원이 콘텐츠나 정보를 게시할 때 공개 범위를 모든 사람으로 설정하면 “잡콜미”를 이용하지 않는 사용자를 비롯하여 모든 사람들이 해당 정보에 접속하여 이를 이용할 수 있으며 해당 정보를 회원(회원의 이름과 프로필 사진)과 연관지을 수 있습니다.
f)“잡콜미”에 대한 의견을 포함한 제안은 언제든지 환영하지만, (회원에게 제안 의무가 없는 것처럼) “잡콜미”도 보상 의무 없이 이를 활용할 수 있습니다
g)회원의 IP콘텐츠는 검색결과 내지 서비스 및 관련 프로모션 등에 노출될 수 있으며, 해당 노출을 위해 필요한 범위 내에서는 일부 수정, 복제, 편집되어 게시될 수 있습니다. 이 경우, “잡콜미”는 저작권법 규정을 준수하며, 회원은 언제든지 고객센터 또는 각 서비스 내 관리기능을 통해 해당 게시물 등에 대해 삭제, 검색결과 제외, 비공개 등의 조치를 취할 수 있습니다.
h)“잡콜미”는 본 조에서 정한 방법 이외의 방법으로 회원의 게시물을 상업적으로 이용하고자 하는 경우, 전화, 팩스, 전자우편 등의 방법을 통해 사전에 회원의 동의를 얻어야 합니다. 단, 회원정보에 등록된 연락처가 사실과 다르거나 회원이 “잡콜미”의 연락에 응하지 않아 사전에 동의를 구하지 못한 경우, “잡콜미”는 사후에 동의 절차를 구할 수 있습니다. “잡콜미”가 본 호에 따라 회원의 IP콘텐츠를 상업적으로 이용할 경우 “잡콜미”는 별도의 보상제도를 운영할 수 있습니다.
2.“잡콜미” 웹사이트에 링크 공유 버튼을 포함시킨다면 다음 각 호에서 정한 사항이 추가 적용됩니다.
a).링크 공유 버튼을 이용할 권한을 부여하는 것은 이용자가 회원의 웹사이트에서 “잡콜미”로 링크하거나 콘텐츠를 게시할 수 있도록 하는 것입니다.
b)회원은 해당 링크나 콘텐츠를 “잡콜미”가 이용할 권한을 “잡콜미”와 타인에게 부여합니다.
c)“잡콜미”에 게시되면 본 정책을 위반할 수 있는 콘텐츠가 담긴 페이지에는 링크 공유 버튼을 게시할 수 없습니다.
제16조 (광고게재 및 광고주와의 거래)
“잡콜미”는 본 서비스 상에 게재된 광고주의 판촉활동 및 광고주와 회원간의 교신 또는 거래의 결과로서 발생하는 모든 손실 또는 손해에 대해 책임을 지지 않습니다.

제17조(서비스 이용시간)
1.서비스의 이용은 “잡콜미”의 업무상 또는 기술상 특별한 지장이 없는 한, 연중무휴1일 24시간 가능함을 원칙으로 합니다. 다만 정기 점검 등의 필요로 “잡콜미”가 정한 기간은 예외입니다.
2.“잡콜미”는 서비스를 일정범위로 분할하여 각 범위 별로 이용가능 시간을 별도로 정할 수 있습니다. 이 경우 사전에 공지를 통해 그 내용을 알립니다.

제18조 (서비스 제공의 중지 등)
1.“잡콜미”는 다음에 해당하는 경우 서비스 제공을 중지할 수 있습니다.
a)정보통신설비의 보수점검⋅교체 및 고장, 통신의 두절 등의 사유가 발생한 경우에는 부득이하게 서비스의 제공을 일시적으로 중단할 수 있습니다.
b)전기통신사업법에 규정된 기간통신사업자가 전기통신 서비스를 중지했을 경우.
c)기타 불가항력적 사유가 있는 경우
2.“잡콜미”는 국가비상사태, 정전, 서비스 설비의 장애 또는 서비스 이용의 폭주 등으로 정상적인 서비스 이용에 지장이 있는 때에는 서비스의 전부 또는 일부를 제한하거나 중지할 수 있습니다.
3.“잡콜미”는 제1항 및 제2항의 규정에 의하여 서비스의 이용을 제한하거나 중지한 때에는 그 사유 및 제한기간 등을 “잡콜미”를 통하여 공지하거나 전자우편 기타의 방법으로 지체 없이 회원에게 알려야 합니다. 다만, 사전에 통지할 수 없는 부득이한 사유가 있는 경우 사후에 통지할 수 있습니다.

제5장 계약해지 및 이용제한

제19조 (계약 해지 및 이용 제한)
1.회원이 이용 계약을 해지하고자 하는 경우에는 온라인 상에서 즉시 회원탈퇴를 실행 하시거나 회원탈퇴 문의 메일을 온라인을 통해 보내주시면 됩니다. 문의 메일을 통해 회원탈퇴를 진행하실 경우에는 최대 24시간의 처리 기간을 갖고 있습니다. 회원은 언제든지 서비스초기화면의 고객센터 또는 내 정보 관리 메뉴 등을 통하여 이용계약 해지 신청을 할 수 있으며, “잡콜미”는 관련법 등이 정하는 바에 따라 이를 즉시 처리합니다.
2.회원이 계약을 해지할 경우, 관련법 및 개인정보보호정책에 따라 “잡콜미”가 회원정보를 보유하는 경우를 제외하고는 해지 즉시 회원의 모든 데이터는 소멸됩니다.
3."회원"이 계약을 해지하는 경우, 본인 계정에 등록된 게시물 일체는 삭제됩니다. 다만, 타인에 의해 담기, 스크랩 등이 되어 재 게시되거나, 공용게시판에 등록된 "게시물" 등은 삭제되지 않으며 삭제를 원할 경우 사전에 삭제 후 탈퇴하여야 합니다.
4.“잡콜미”는 회원이 본 약관 제11조의 의무를 위반하거나, 기타 본 약관에 따른 의무를 위반하는 행위를 하였을 경우 이용계약을 해지하거나 또는 서비스 이용 중지, 기타 서비스 이용을 제한할 수 있습니다.

제6장 회원 통합 가입

제20조 (회원 통합ID와 비밀번호)
1.“잡콜미”가 “잡콜미” 플랫폼 외에 별도로 운영하고 있는 사이트(이하 “패밀리 사이트”라고 합니다.)의 서비스를 회원이 원활하게 이용할 수 있도록 회원의 ID(아이디)와 비밀번호를 통합하여 사용할 수 있는 통합ID 서비스를 제공하고 있습니다. 회사가 운영하고 있는 사이트는 다음 각 호와 같습니다.
a)“아홉” 용역 및 작업 등의 재능 판매, 구매 서비스 사이트 (www.Ahop.me, 스마트폰 등 이동통신기기를 통해 제공되는 모바일 서비스를 포함합니다.)
b)“내일검색” “잡콜미” 취업정보 검색 사이트(naeil.incruit.com, 스마트폰 등 이동통신기기를 통해 제공되는 모바일 서비스를 포함합니다.)
2.회원의 ID(아이디)와 비밀번호, 이름, 휴대폰번호, 생년월일, 성별 이외의 정보는 패밀리 사이트에서 사용하지 않습니다.
3.회원 통합ID와 비밀번호를 사용하기 위해서는 패밀리 사이트의 모든 이용 약관 및 개인정보 취급방침에 동의하는 절차를 완료하여야 합니다.
4.회원 통합ID와 비밀번호를 통해 사용할 수 있는 패밀리 사이트는 회사의 정책에 따라 추가/변동될 수 있습니다. 단, 이런 경우에는 추가/변동되는 패밀리 사이트의 이용약관에 동의하는 절차를 완료하여야 합니다.
5.회원 통합ID와 비밀번호 관리 및 그 책임에 관한 사항은 이 약관 제11조를 따릅니다.

2.	제7장 손해배상 및 기타 사항
3.	
제21조 (손해배상 및 면책)
1.천재지변 또는 이에 준하는 불가항력으로 인하여 서비스를 제공할 수 없는 경우에는 “잡콜미”의 서비스 제공에 관한 책임이 면제됩니다.
2.“잡콜미”는 회원의 귀책사유로 인한 서비스 이용의 장애에 대하여 책임을 지지 않습니다.
3.“잡콜미”는 회원이 서비스를 이용하여 기대하는 수익을 상실한 것이나 서비스를 통하여 얻은 자료로 인한 손해에 관하여 책임을 지지 않습니다.
4.“잡콜미”는 제휴회사가 제공하거나 회원이 서비스에 게재한 정보, 자료 등의 사실 유무 신뢰도, 정확성 등에 관하여는 책임을 지지 않습니다.
5.“잡콜미”는 서비스 이용과 관련하여 가입자에게 발생한 손해 가운데 가입자의 고의, 과실에 의한 손해에 대하여 책임을 지지 않습니다.

4.	제22조 (이용자 보호)
1.“잡콜미”는 이용자의 권익을 보호하기 위해, 상호명, 대표자 성명, 영업소 소재지와 전화번호, 팩스번호, E-mail, 사업자등록번호 등 “잡콜미”의 신원정보를 홈페이지를 통해 표시하고 있습니다.
2.“잡콜미”는 서비스 이용약관을 공시하여 이용자의 피해를 최소화하기 위해 노력합니다.

5.	제23조 (분쟁 해결)
1.“잡콜미”는 이용자로부터 제기되는 불만사항 및 의견을 우선적으로 처리합니다. 다만, 신속한 처리가 곤란한 경우에는 이용자에게 그 사유와 처리 일정을 즉시 통보합니다.
2.“잡콜미”와 회원은 서비스와 관련하여 발생한 분쟁을 원만하게 해결하기 위하여 필요한 모든 노력을 합니다.
3.회원의 “잡콜미”에서의 활동이나 콘텐츠, 정보와 관련하여 타인이 “잡콜미”를 상대로 클레임을 제기하면, 회원은 해당 클레임과 관련된 손해나 손실, 경비(합리적인 변호사 수임료와 비용 포함)로부터 “잡콜미”를 면책 및 보호해야 합니다.
4.“잡콜미”는 제3자의 활동, 콘텐츠, 정보, 데이터에 대해 책임지지 않으며, 인지 여부에 관계 없이 해당 제3자를 상대로 제기하는 클레임으로 인하거나 그와 관련하여 발생하는 클레임과 손해로부터 “잡콜미”와 “잡콜미”의 이사, 임직원을 면책합니다. 본 조항이나 “잡콜미”로 인하여 발생하는 채무 총액은 지난 일년간 “잡콜미”에 납부한 금액을 초과할 수 없습니다.
5.제1항 내지 제4항과 관련하여 발생하는 법률분쟁은 서울중앙지방법원을 배타적인 제1심 전속관할 법원으로 하여 해결합니다.

