'safety_text' => "소중한 회원 여러분, 파키스탄의 일자리를 구하는 Jobcallme.com에 가입 해 주셔서 감사드립니다. Jobcallme.com은 각 고용주에게 연락하여 해당 상태를 확인하는 유일한 취업 사이트입니다. 따라서 당사 웹 사이트에 게시 된 모든 직무는 정품이며 공인 된 직원 만 게시 할 수 있습니다. 제한된 자원으로 인해 우리가 각 고용주에 대한 심층적 인 검증을 실제로 실시 할 수는 없다는 것을 이해하시기 바랍니다. 귀하는 구직 신청자가 취업 신청서와 함께 한 구실로 다른 금액을 지불하도록 요구되는 취업 사기에주의해야한다고 권고합니다. 구직 신청 프로세스의 일환으로, 채용 담당자 / 고용주 / 대행사는 교육 자료, 인터뷰 비용, 테스트 비용 등과 같은 채용 또는 처리 서비스에 대한 비용을 지불하지 않아야합니다. CV / 재개 개선 또는 관리 비용 등등. 그러므로 개인 은행 계좌를 통해 지불을 처리하고 웨스턴 유니온 (Western Union) 또는 머니 그램 (Moneygram)과 같은 유선 서비스로 돈을 확인하거나 이체해야하는 직무를 신청하지 않는 것이 좋습니다. Jobcallme.com에서 일자리의 질을 보장하기 위해 어떤 조치를 취하고 있는지 알고 있습니까? Jobcallme.com은 고용주를 위해 쉽고 빠르게 등록합니다. 그러나 우리는 구직자가 계속해서 서비스 혜택을 누릴 수 있도록 특정 품질 기준을 충족하는지 확인합니다. 작업 품질은 Jobcallme.com에서 엄격히 통제되며 웹 사이트의 모든 활동은 연중 무휴로 모니터링됩니다. 우리 사이트에서는 다음과 같은 행위를 허용하지 않습니다 : 등록시 부정확하거나 오도 된 계정 또는 연락처 정보 제공 Jobcallme.com의 모든 신규 고용주 계정은 검토 및 검증 과정을 거치며, 그들의 일이 우리의 웹 사이트에 유효하게되기 전에. 불완전하거나 잘못된 연락처 정보가있는 고용주 계정을 발견하면 즉시 계정을 삭제합니다. 차별적 인 언어 - 인종, 성적, 종교 또는 연령 - 우리는 모든 사람들에게 차별없이 평등 한 고용 기회를 믿습니다. 신청자에 대한 차별적 인 언어 / 행동을 포함하는 직업을 찾을 때마다 즉시이를 제거합니다. 직접 또는 간접적으로 (예 : '이메일 처리'또는 '집에서 일하기'계획을 통해) 후보자에게 돈 또는 은행 정보를 요청하십시오 - 고용주가 구직자에게 돈을 요청하는 직업을 강력히 권장합니다. 또한 각 작업 페이지 상단에 구직자에게 고용주에게 어떠한 지불도하지 말 것을 지시하는 경고 메시지와 Jobcallme에서 구인 게시를 발견하는 경고 메시지를 추가했습니다. co.kr 및 고용주가 신청, 인터뷰, 테스트 등을 처리하기 위해 돈을 요청하면 즉시 support@Jobcallme.com에 신고해야합니다. 마찬가지로 Jobcallme.com에서는 'Email Processing'또는 'Work from Home'과 같은 구인 게시도 허용되지 않습니다. 비즈니스 기회, 네트워크 마케팅 또는 '부유 한 빠른'계획 승격 - 비즈니스 홍보로 보이는 구인 게시 기회, 네트워크 마케팅 또는 부유 한 더 빠른 계획은 가짜 및 사기이기 때문에 Jobcallme.com에서 그러한 취업 알선을 발견하면 즉시 제거합니다. Jobcallme.com은 책임있는 고용주를 따뜻하게 환영하며 우리의 서비스를 통해 성공을 기원합니다. 안전한 온라인 구직 신청을위한 팁 우리는 Jobcallme.com에서 일의 질을 유지하기 위해 열심히 노력하며, Jobcallme.com 또는 다른 직업 사이트에서 일자리를 검색하고 신청할 때 다음과 같은 충고를 명심하십시오 : Google 및 고용주에 관한 기본 정보를 찾으십시오. 은행 계좌 정보, 개인 정보 재정 정보를 제공하거나 직업을 신청할 때 어떤 사람이나 조직에게 돈을 지불해야합니다. 구직 신청 프로세스의 일환으로, 채용 담당자 / 고용주 / 대행사는 교육 자료, 면접 비용, 테스트 비용, 이력서 / 이력서 개선 또는 관리 비용 등과 같은 채용 또는 처리 서비스에 대한 수수료를 절대로 지불해서는 안됩니다. 여기서 역할은 개인 은행 계좌를 통해 지불을 처리하거나 Western Union 또는 Moneygram과 같은 유선 서비스를 통해 송금해야하는 경우입니다. 마침내, 당신이 진실하기에는 너무 좋게 보이는 기회를 보게된다면, 알려 주시면 자세히 조사하겠습니다. Jobcallme.com에서 볼 수있는 일자리에 대한 의문점이있는 경우 고객 지원팀에보고하면 즉각적인 조치를 취할 것입니다. Jobcallme.com은 구직자와 고용주 모두에게 최상의 최상의 안전한 고객 경험을 제공하기 위해 노력하고 있습니다. 우리는 이와 관련하여 귀하의 협조를 구하고 손실 / 책임을 포기합니다. 질문이 있으시면 support@Jobcallme.com으로 연락 주저하지 마십시오. Jobcallme.com을 사용하여 성공을 기원합니다! com은 구직자와 고용주 모두에게 최상의 최상의 고객 경험을 제공하기 위해 열심히 노력하고 있습니다. 우리는 이와 관련하여 귀하의 협조를 구하고 손실 / 책임을 포기합니다. 질문이 있으시면 support@Jobcallme.com으로 연락 주저하지 마십시오. Jobcallme.com을 사용하여 성공을 기원합니다! com은 구직자와 고용주 모두에게 최상의 최상의 고객 경험을 제공하기 위해 열심히 노력하고 있습니다. 우리는 이와 관련하여 귀하의 협조를 구하고 손실 / 책임을 포기합니다. 질문이 있으시면 support@Jobcallme.com으로 연락 주저하지 마십시오. Jobcallme.com을 사용하여 성공을 기원합니다! ",
